function createBall(config, num) {
	var ballConfig = Object.assign({}, config)
	ballConfig.name = ballConfig.name + num
	createSprite(ballConfig, true)
}

function createSprite(config, enabled, onTouchStart, onTouchEnd) {
	var frames = config.frames
	var img = new Image();
	img.onload = function() {
		var spriteObj = new Konva.Sprite({
			x: config.posX,
			y: config.posY,
			rotation: config.rotation,
			image: img,
			animation: 'idle',
			animations: frames,
			frameRate: config.frameRate,
			frameIndex: 0,
			globalCompositeOperation: config.blendMode,
			height : config.height,
			width : config.width,
			scaleX : config.scaleX,
			scaleY : config.scaleY,
			drawBorder : true,
			offsetX : config.offsetX,
			offsetY : config.offsetY
		});

		if (onTouchStart) {
			spriteObj.on('mousedown touchstart', onTouchStart)
		}
		if (onTouchEnd) {
			spriteObj.on('mouseup touchend', onTouchEnd)
		}
		config.layer.add(spriteObj);
		config.stage.add(config.layer);
		spriteObj.start();
		if (!enabled) {
			spriteObj.hide()
		}
		sprites.set(config.name, spriteObj)
	};
	img.src = config.src;
}

function getFrames(width, height, columns, rows) {
	var frames = {
		idle : []
	}
	for (var i = 0; i < columns; i++){
		for (var j = 0; j < rows; j++) {
			frames.idle.push(width/columns * i)
			frames.idle.push(height/rows * j)
			frames.idle.push(width/columns)
			frames.idle.push(height/rows)
		}
	}
	return frames;
}

function getAnimationKeyFrames(width, height, columns, rows, startFrame, endFrame) {
	var keyFrames = []
	var frameCounter = -1
	for (var i = 0; i < rows; i++){
		for (var j = 0; j < columns; j++) {
			frameCounter++;
			if (frameCounter < startFrame || frameCounter > endFrame) {
				continue;
			}
			keyFrames.push(width/columns * j)
			keyFrames.push(height/rows * i)
			keyFrames.push(width/columns)
			keyFrames.push(height/rows)
		}
	}
	return keyFrames
}

shootYellow = function () {
	var targetPos = sprites.get("targetYellow").getAbsolutePosition()

	var tween = new Konva.Tween({
		node: sprites.get("projectileYellow"),
		x : targetPos.x / pageScale - 42,
		y : targetPos.y / pageScale - 22,
		duration: 0.15,
		easing: Konva.Easings.EaseIn
	});
	// alert("aim " + (targetPos.x) + " " + (targetPos.y))
	sprites.get("beamYellowFirst").hide()
	sprites.get("targetYellow").hide()
	tween.play()
	setTimeout(function(){
		animateOwl(sprites.get("owlYellow"), {x:-500, y:-500})
	}, 800)
	setTimeout(function () {
		delayedAnimation(sprites.get("projectileYellow"), 'trigger', 0, 800)
		delayedAnimation(sprites.get("ballWithBirdYellowOne"), 'trigger', 0, 800)
		for (var i = 0; i < 27; i++) {
			delayedAnimation(sprites.get("ballsYellow" + i), 'trigger', 10 * i, 800)
		}
	}, 500)
	playFogAnimation(sprites.get("shotFogYellow"))
	rotateProjectile(sprites.get("projectileBlue"))
}

aimYellow = function () {
	sprites.get("beamYellowFirst").show()
	sprites.get("targetYellow").show()
}

animateOwl = function (owl, moveTo) {
	owl.show()
	var tween = new Konva.Tween({
		node: owl,
		// x : 0,
		// y : 0,
		duration: 1,
		easing: Konva.Easings.EaseIn,
		scaleX : 1,
		scaleY : 1
	})
	// alert("aim " + (targetPos.x) + " " + (targetPos.y))
	tween.play()
	setTimeout(function () {
		var move = new Konva.Tween({
			node: owl,
			x : moveTo.x,
			y : moveTo.y,
			duration: 1,
			easing: Konva.Easings.EaseIn,
			onFinish : function () {
				owl.destroy()
			}
		})
		move.play()
	}, 2100)
}

