buttonShootProjectile = function () {
	switch(ballLaunchState) {
		case 0:
			shootYellow()
			ballLaunchState++
			break
		case 1:
			shootBlue()
			ballLaunchState++
			break
		case 2:
			shootRed()
			ballLaunchState++
			break
		case 3:
			shootYellowTwo()
			ballLaunchState++
			break
		default:
			break
	}
}

buttonAimProjectile = function () {
	switch(ballLaunchState) {
		case 0:
			aimYellow()
			break
		case 1:
			aimBlue()
			break
		case 2:
			aimRed()
			break
		case 3:
			aimYellowTwo()
			break
		default:
			break
	}
}

function rotateProjectile(projectile) {
	var rotateTween = new Konva.Tween({
		node: projectile,
		rotation : 0,
		duration: 0.4,
		easing: Konva.Easings.EaseInOut,
		onFinish : function () {
		}
	})
	rotateTween.play()
}

